    <script>
        var gRecaptchaPublicKey = '6LfyQRoUAAAAAApqS-inJxUwCOtvOHwKxJuZCsuv',
            recaptchaComplete = false;

        function initCaptcha(err, submit) {
            if(captchaType) {
                captchaType.value = 'v2';
            }
            var captchas = '',
                signupModal = submit ? MG_Utils.closest(submit, '#login_signup_modal_signup') : false,
                signupModalCaptchas = '',
                pf_captchas = '';
                if(signupModal) {
                    signupModalCaptchas = signupModal.getElementsByClassName('g-recaptcha');
                    pf_captchas = signupModal.getElementsByClassName('pfCaptchaToken');
                }
            if(submit && signupModalCaptchas) {
                captchas = signupModalCaptchas;
            } else {
                captchas = document.querySelectorAll('.g-recaptcha:not(.signinModalCaptcha)');
            }

            if (captchas.length > 0) {
                for (var i = 0; i < captchas.length; i++) {
                    var widgetId = grecaptcha.render(captchas[i], {
                        'sitekey' : gRecaptchaPublicKey,
                        'theme' : 'dark',
                        'callback' : function (response) {
                            if(pf_captchas.length) {
                                for (var t = 0; t < pf_captchas.length; t++){
                                    pf_captchas[t].value = response;
                                }
                            } else if(captchaToken) {
                                captchaToken.value = response;
                            }
                            verifiedCallback();
                        },
                        'expired-callback': function() {
                            expiredCallback();
                        }
                    });
                    captchas[i].setAttribute('id', 'cpt-'+widgetId);
                }
                function verifiedCallback() {
                    recaptchaComplete = true;
                    var signupError = document.getElementById('errors'),
                        supportSendMessage = document.querySelector('.js-sendMessageSupport');
                    if (err) {
                        err.innerHTML = "";
                        err.style.display = "none";
                    } else if (signupError && signupError.innerText.indexOf('Captcha') > -1){
                        signupError.style.display = "none";
                    }
                    if (submit) {
                        MG_Utils.removeClass(submit, "disabled");
                    }

                    if(supportSendMessage) {
                        MG_Utils.setData(supportSendMessage, 'verified-captcha', 1);
                    }
                }

                function expiredCallback() {
                    var supportSendMessage = document.querySelector('.js-sendMessageSupport');

                    if(supportSendMessage) {
                        MG_Utils.setData(supportSendMessage, 'verified-captcha', 0);
                    }
                }
            }
        }
    </script>

